import React from "react";
import styled from "styled-components";

const Ul = styled.ul`
  list-style: none;
  display: flex;
  flew-flow: row nowrap;

  li {
    padding: 5px;
  }

  @media (max-width: 768px) {
    flex-flow: column nowrap;
    background-color: #F8E1D5;
    position: fixed;
    top: 0; 
    right: 0;
    height: 100vh;
    width: 200px;
  }
`;

const RightNav = () => {
  return (
    <div>
      <Ul>
        <li>Home</li>
        <li>Skills</li>
        <li>Background</li>
        <li>Contact</li>
      </Ul>
    </div>
  );
};

export default RightNav;
